Proper way to use MongoDB client in async/await Express routers<p>What is the proper way to manage MongoDB clients in async/await Express routers?</p>

<p>I'm trying to create a MongoDB client in a router middleware so that it's available to all requests. Here's a simplified example:</p>

<pre><code>const express = require('express');
const { MongoClient } = require('mongodb');

let router = express.Router();

router.use(async (req, res, next) =&gt; {
    try {
        req.client = await MongoClient.connect(process.env.MONGODB_URI);
        next();
    } catch (err) {
        next(err);
    } finally {
        req.client &amp;&amp; req.client.close();
    }
});

router.get('/', async (req, res, next) =&gt; {
    let user = await users.findOne({ name: 'foo' });
    if (!user) {
        user = { name: 'foo' };
        await users.insert(user);
    }
    res.json(user);
});

module.exports = router;
</code></pre>

<p>Unfortunately, after calling <code>await users.findOne({ name: 'foo' })</code>, the execution jumps to the <code>finally</code> branch in the middleware, the MongoDB connection is closed, and the potential call to <code>await users.insert(user)</code> fails because of that.</p>

<p>Thanks for help!</p>

