<pre><code>// this code insert only first document using capped collection 
MongoDatabase database = mongoClient.getDatabase("db");
        database.createCollection("capped_collection",
                new CreateCollectionOptions().capped(true).sizeInBytes(536870912).maxDocuments(5000));

        MongoCollection&lt;Document&gt; collection = database.getCollection("capped_collection");

        Document found = database.getCollection("capped_collection").find(new Document("title", title)
                .append("url", url)
                .append("img", img)
                .append("price", price)).first();

        if (found == null) {

            collection.insertOne(new Document("title", title)
                            .append("url", url)
                            .append("img", img)
                            .append("price", price));

            mongoClient.close();
    }
</code></pre>

<p>In this case capped collection gives me to insert only first document and that's all (I want several not one). If I create normal collection I can insert several docs. Why it happens?</p>

<pre><code>MongoDatabase database = mongoClient.getDatabase("db");
        MongoCollection&lt;Document&gt; collection = database.getCollection("normal_collection");

        Document found = database.getCollection("normal_collection").find(new Document("title", title)
                .append("url", url)
                .append("img", img)
                .append("price", price)).first();

        if (found == null) {
            collection.insertOne(new Document("title", title)
                            .append("url", url)
                            .append("img", img)
                            .append("price", price));

            mongoClient.close();
        }
</code></pre>

<p>In this way I can insert several documents using normal collection.</p>

<p>As I understand properly, there is no difference in the code between inserting documents into a capped collection and a normal collection, but in fact I have different results.</p>

