        sku: prod1,
        qty: 100

    }, ...
    ]
}


result should be

{
    _id: objectId,
    supplierId: objectId1,      // supplier 1
    sku: "prod1",
    qty: 5
},
{
    _id: objectId,
    supplierId: objectId1,      // supplier 1
